import React, {useState, useEffect} from 'react'
import { connect } from 'react-redux'
import {setCoinsThunkCreator} from '../../redux/coin-reducer'

const CoinElement = (props) => {

    const click = () =>{
        props.setCoinsThunkCreator()
    }

    if(typeof(props))
    return (
      <div>
          <button onClick={click}>click</button>
        <div>
          <img src={props.img} />
        </div>
        <div>
          <div>{props.name}</div>
        </div>
        <div>
          <div>${(+props.price)}</div>
        </div>
        <div>
          <div>{+props.price_change_prc}</div>
        </div>
        <div>
        </div>
      </div>
    );
  };

  const CoinContainer1 = connect(null, {setCoinsThunkCreator})(CoinElement)

export default CoinContainer1
